CWSAT0053E=CWSAT0053E: El trabajo {0} del trabajador {1} no se encuentra en la base de datos. La llamada {2} se colgar\u00e1.
CWSAT0053E.explanation=Al validar la conversaci\u00f3n, se ha descubierto que el trabajo asociado con la prueba no se encontraba en la base de datos.
CWSAT0053E.useraction=Compruebe el archivo trace.log para obtener un rastreo de pila completo del error que se ha producido al buscar el trabajo. Esto ocurre normalmente si el trabajo se ha suprimido de la base de datos.

CWSAT0054W=CWSAT0054W: La llamada {0} en la que estaba el trabajo {1} ha finalizado porque faltaban algunas dependencias necesarias para una validaci\u00f3n satisfactoria.
CWSAT0054W.explanation=Al validar la conversaci\u00f3n faltaba un recurso importante necesario para una validaci\u00f3n satisfactoria. Esto ocurre normalmente si el caso de prueba en el que estaba el trabajo se ha suprimido de la base de datos o si el mismo trabajo se ha suprimido de la base de datos.
CWSAT0054W.useraction=Compruebe el archivo trace.log para obtener un rastreo de pila completo del error que se ha producido al ejecutar la prueba de la llamada.

CWSAT0055E=CWSAT0055E: En el trabajo {0} que ejecuta la llamada {1} no se ha podido encontrar el caso de prueba {2}.
CWSAT0055E.explanation=No se ha encontrado el siguiente caso de prueba necesario para el trabajo que ejecuta las pruebas. Esto ocurre normalmente cuando se ha suprimido el caso de prueba.
CWSAT0055E.useraction=Verifique que el caso de prueba existe y si no es as\u00ed, actualice los casos de trabajador y vuelva a iniciar el trabajo. Si el caso de prueba existe, compruebe el archivo trace.log para obtener un rastreo de pila completo del error que se ha producido al ejecutar la prueba de la llamada.

CWSAT0056E=CWSAT0056E: El trabajo {0} que ejecuta la llamada {1} se ha encontrado en ejecuci\u00f3n con un estado inesperado {2} que no es v\u00e1lido.
CWSAT0056E.explanation=Se ha producido un error inesperado que ha provocado que el trabajo se ejecute con un estado que no es v\u00e1lido para ejecutar pruebas.
CWSAT0056E.useraction=Compruebe el archivo trace.log para obtener un rastreo de pila completo del error producido que puede haber provocado esto. Normalmente esto no deber\u00eda ocurrir.

CWSAT0057E=CWSAT0057E: No se ha podido iniciar la llamada saliente para la prueba siguiente y, por lo tanto, el trabajo {0} no ha podido seguir ejecut\u00e1ndose.
CWSAT0057E.explanation=El trabajo no ha podido continuar porque no se ha podido iniciar una llamada saliente para la prueba. Esto ocurre normalmente si Voice Gateway que controla las llamadas se desactiva y la API REST de llamadas salientes no est\u00e1 disponible.
CWSAT0057E.useraction=Verifique que se est\u00e1 ejecutando Voice Gateway que controla las llamadas salientes. Si es as\u00ed, compruebe el archivo trace.log del microservicio y si es necesario de Voice Gateway que controla las llamadas salientes para ver qu\u00e9 error se ha producido.

CWSAT0058E=CWSAT0058E: En el caso de prueba {0}, no se ha podido analizar una lista de la matriz de transformaciones. Se ha encontrado un elemento no v\u00e1lido en la lista.
CWSAT0058E.explanation=La transformaci\u00f3n actual del caso de prueba conten\u00eda un tipo de lista que no se ha podido analizar. Esto ocurre normalmente si el caso de prueba se edita fuera de la API REST.
CWSAT0058E.useraction=Compruebe qu\u00e9 lista en el caso de prueba debe cambiarse y actualice en consecuencia para convertirla en un caso de prueba v\u00e1lido.

CWSAT0059I=CWSAT0059I: Voice Agent Tester versi\u00f3n {0} est\u00e1 disponible para ejecutar pruebas.
CWSAT0059I.explanation=Voice Agent Tester se ha iniciado y ahora puede aceptar llamadas.
CWSAT0059I.useraction=No es necesaria ninguna acci\u00f3n.
